import LeftArrow from "../../../../../shared/LeftArrow/LeftArrow";
import RightArrow from "../../../../../shared/RightArrow/RightArrow";
import React from "react";
import {
    UsersPaginationActions
} from "../../../../../redux/UsersPaginationActions";


const Pagination = (props) => {
    const pages = props.page_count / props.page_size
	const page_numbers = pages ? [...Array(pages+1).keys()].splice(1) : []
	const previous = () =>
		props.updateCurrentPageOnArrows(UsersPaginationActions.Previous)
	const next = () =>
        props.updateCurrentPageOnArrows(UsersPaginationActions.Next)

    return <div className="pagination">
            <div className="pagination__container">
                <span className='pagination__left_arrow' onClick={ previous }>
                    <LeftArrow/>
                </span>
                { page_numbers.map(page_number => {
                    const classname = `pagination__item${
                        props.current_page === page_number ? " selected" : ""
                    }`
                    return (
                        <span className={ classname }
                              onClick={ () => props.updateCurrentPage(page_number) }>
                              { page_number }
                        </span>)
                }) }
                <span className='pagination__right_arrow' onClick={ next }>
                    <RightArrow/>
                </span>
            </div>
        </div>
}

export default Pagination;
